import React from "react";
import NewOrders from "../components/orders/NewOrders";
import { Switch, Route, Redirect } from "react-router-dom";
import { SEC_NAV_DATA } from "../staticData/SecNavData";
import ConfirmedOrders from "../components/orders/ConfirmedOrders";

export default function Orders(props) {
  return (
    <Switch>

      {SEC_NAV_DATA.map((data) => {
            <Route path={data.path}><NewOrders/></Route>
      })

      }

      {/* <Route path="/orders/neworders">
          <NewOrders/>
      </Route>
      <Route path="/orders/confirmedorders">
          <ConfirmedOrders/>
      </Route>*/}

    </Switch> 
  );
}
